import React from "react";

const Projectmenu = ({ filterItem, menuList }) => {
  return (
    <>
      {menuList.map((curElem) => {
        return (
          <button className="btn-group__item" onClick={() => filterItem(curElem)}> {curElem} </button>
        );
      })}
    </>
  );
};

export default Projectmenu;
